export function decodeToHEX(str) {
  return byteArrayToHex(base64.toByteArray(padding(str)));
}

export function base64ToBase64Url(base64String) {
  var SAFE_URL_ENCODING_MAPPING = {
    '+': '-',
    '/': '_',
    '=': ''
